import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const CrudDemo = () => {
  const [persons, setPersons] = useState([]);

  useEffect(() => {
    fetch('api/persons')
      .then(res => res.json())
      .then(data => setPersons(data))
  }, []);

  return (
    <div>
      <Table persons={persons} />
    </div>
  );
}
export default CrudDemo;
